import React, {useState} from 'react';
import {Text, StyleSheet, View, ImageBackground,ScrollView,Image} from 'react-native';
import styled from 'styled-components/native';
import ResponsiveImage from 'react-native-responsive-image';
import {SafeAreaView} from 'react-native-safe-area-context';
import {
  heightPercentageToDP,
  widthPercentageToDP,
} from 'react-native-responsive-screen';
import {KeyboardAwareScrollView} from 'react-native-keyboard-aware-scrollview';
import {useNavigation, DrawerActions} from '@react-navigation/native';

import {
  menu,
  dummyimage,
  dots,
  image1,
  image2,
  downarrow,
  image3,
  image4,
  image9,
  image10,
  image5,
  image6,
  image11,
  image12,
  image7,
  image8,
  bottomadd,
  backicon,
  welcomepagebackground,
  photoworld,
  backfirst,
  backsec,
  botomView,headerView 
} from '../../common/images';
import {Form, Content, Picker, Container, Icon} from 'native-base';
import {TouchableOpacity} from 'react-native-gesture-handler';
import { Header } from 'react-native/Libraries/NewAppScreen';
import TopHeader from '../../components/header';
// import { Form } from 'formik';
const PhotoWorld = () => {
  const navigation = useNavigation();
  const [Value, setValue] = useState('key11');

  return (
   
    <View>

    {/* <Image source={headerView}/>
        <WelcomeView>
          <TouchableOpacity
                onPress={() => {
                  navigation.goBack()
                }}>
            <View style={{flexDirection:'row',justifyContent:'space-between'}}>
            <BackIcon source={backicon} initHeight="16" initWidth="16" />
            <WelcomeText>Photo World</WelcomeText>
          </View>
          </TouchableOpacity>
          <TouchableOpacity
            onPress={() => {
              navigation.dispatch(DrawerActions.openDrawer());
            }}>
            <MenuIcon source={menu} initHeight="30" initWidth="30" />
          </TouchableOpacity>
        </WelcomeView> */}
        
        <TopHeader title="Photo World" backButton="true" />
        <BackgroundImage source={botomView}>
        <View  style={{ flex:Platform.OS === 'ios' ? 1 : .69}}>
            <ScrollView >
        <View style={{flexDirection: 'row', justifyContent: 'space-between'}}>
          <TextView>Today</TextView>
          <TouchableOpacity
          style={{height:30,width:100,marginTop: heightPercentageToDP(6.4)}}
            onPress={() => {
              navigation.navigate('TodayGallery');
            }}>
            <Text
              style={{
                // marginTop: heightPercentageToDP(6.4),
                 marginRight: 3,
                 textAlign:'right',
                fontSize: 16,
                color: '#A176C5',
                fontFamily: 'FuturaPT-Book',
              }}>
              View More
            </Text>
          </TouchableOpacity>
        </View>
        <FirstView>
          <ImagesView source={image1} initHeight="98" initWidth="98" />
          <ImagesView source={image2} initHeight="98" initWidth="98" />
          <ImagesView source={image3} initHeight="98" initWidth="98" />
          <ImagesView source={image4} initHeight="98" initWidth="98" />
          <ImageBackground
            source={backsec}
            style={{
              height: 0,
              width: 70,
              borderRadius: 50,
              position: 'absolute',
              right: widthPercentageToDP(1),
             // marginTop: -heightPercentageToDP(4),
            }}
          />
        </FirstView>
        <View style={{flexDirection: 'row', justifyContent: 'space-between'}}>
          <TextView>Week</TextView>
          <TouchableOpacity
          style={{height:30,width:100,marginTop: heightPercentageToDP(6.4)}}
            onPress={() => {
              navigation.navigate('TodayGallery');
            }}>
            <Text
              style={{
                // marginTop: heightPercentageToDP(6.4),
                 marginRight: 3,
                 textAlign:'right',
                fontSize: 16,
                color: '#A176C5',
                fontFamily: 'FuturaPT-Book',
               
              }}>
              View More
            </Text>
          </TouchableOpacity>
        </View>
        <FirstView>
          <ImagesView source={image5} initHeight="98" initWidth="98" />
          <ImagesView source={image7} initHeight="98" initWidth="98" />
          <ImagesView source={image7} initHeight="98" initWidth="98" />
          <ImagesView source={image8} initHeight="98" initWidth="98" />
        </FirstView>

        <MainView>
          <View>
            <ImageBackground
              source={backfirst}
              style={{
                height: heightPercentageToDP(30),
                width: widthPercentageToDP(50),
                alignItems: 'center',
                marginBottom: -heightPercentageToDP(6),
                marginLeft: -widthPercentageToDP(6),
                marginTop: -heightPercentageToDP(9),
              }}
            />
            <FirstViewText>
              <TextMonth>Month</TextMonth>
            </FirstViewText>
          </View>
          <Picker
            style={{
              justifyContent: 'flex-end',
              alignSelf: 'flex-end',
              marginLeft: widthPercentageToDP(23),
              marginTop: heightPercentageToDP(1),
            }}
            mode="dropdown"
            placeholder="Select One"
            textStyle={{
              fontSize: 19,
              fontWeight: '600',
              color: '#484848',
